import { Image } from "react-bootstrap";
import "./HomeComp.css";

function HomeComp(props) {
  return (
    <div className="rectangle">
      <Image
        className="rectangle"
        src={props.imageSrc}
        alt={props.altName}
        fluid
      ></Image>
      <div className="center">
        <h1>Enjoy</h1>
        <h2>Your Stay</h2>
      </div>
    </div>
  );
}

export default HomeComp;
